    adapterProt.getDomain = function() {
        return this._domain;
    };

    adapterProt.getRange = function() {
        return this._range;
    };

    adapterProt.getRules = function() {
        return this._rules;
    };

    adapterProt.hasValidOthers = function() {
        return this._hasValidOthers;
    };

    adapterProt.others = function() {
        return this._others;
    };
    
    return SemanticManager;
